import ImageOne from "../images/house1.jpg";
import ImageTwo from "../images/house2.jpg";
import ImageThree from "../images/house3.jpg";

export const SliderData = [
  {
    title: "Luxury Villa in Bali, Ind",
    price: "$420",
    path: "/homes",
    label: "View Home",
    image: ImageOne,
    alt: "Home",
  },
  {
    title: "Luxury Villa in Vancouver",
    price: "$520",
    path: "/homes",
    label: "View Home",
    image: ImageTwo,
    alt: "Home",
  },
  {
    title: "Luxury Villa in Surrey",
    price: "$720",
    path: "/homes",
    label: "View Home",
    image: ImageThree,
    alt: "Home",
  },
];
